import React, { Fragment } from "react";
import ReactDOM from "react-dom/client";

import "./index.css";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.Fragment>
    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/00/Brooklyn_Bridge_Manhattan.jpg/1200px-Brooklyn_Bridge_Manhattan.jpg" alt="background" />
    <App />
  </React.Fragment>
);
